class Footer extends Component{
    render() {
  return (
  		<div className="footer">
  			2019 Douglas Coke Portfolio&nbsp;<i>Built in React</i>&nbsp;<span><i class="fab fa-spin fa-react"></i></span>
  		</div>
    );
  }
}

export default Footer;
